var Rbac = window.Rbac || {};

/**
 * AJAX
 * @module Rbac.common
 */
(function (Rbac) {

    Rbac.ajax = {
        /**
         * ajax 
         * @param params
         * {
		 * type:'POST',data:, href:ajaxurl, successTitle:,  successFnc:, errorFnc:
		 * }
         */
        request: function (params) {
            var params = params || {},
                _type = params.type || 'POST',
                _data = params.data || {},
                _close = params.close || {},
                _successFnc = params.successFnc || function () {
                        window.location.reload();
                    },
                _successTitle = params.successTitle || '',
                _errorFnc = params.errorFnc || function () {
                        swal('', 'error');
                    };
            $.ajax({
                url: params.href, type: _type, data: _data
            }).done(function (data) {
                if (data.status == 1) {
                    swal({
                        title: _successTitle,
                        type: 'success',
                        confirmButtonColor: '#8CD4F5',
                        closeOnConfirm: _close
                    }).then(function(isConfirm) {
                        _successFnc()
                    });
                } else if (data.status == -1) {
                    swal(data.msg, '', 'error');
                } else {
                    _errorFnc()
                }
            }).fail(function () {
                swal('', '', 'error');
            });
        },
        /**
         * 
         * @param params
         * {
		 * data:, confirmTitle:, href:ajaxurl, successTitle:,  successFnc:, errorFnc:
		 * }
         * @returns {jQuery}
         */
        delete: function (params) {
            var params = params || {},
                _confirmTitle = params.confirmTitle || '?',
                _successFnc = params.successFnc || function () {
                        window.location.reload();
                    },
                _successTitle = params.successTitle || '',
                _errorFnc = params.errorFnc || function () {
                        swal('', 'error');
                    }, _this = this;
            swal({
                title: _confirmTitle,
                type: "warning",
                showCancelButton: true,
                closeOnConfirm: false,
                showLoaderOnConfirm: true
            }).then(function(isConfirm) {
                if (params.type == undefined) {
                    params.type = 'DELETE';
                }
                _this.request(params);
            });
        },
        /**
         *
         * @param params
         * {
		 * confirmTitle:, href:ajaxurl, successTitle:,  successFnc:, errorFnc:
		 * }
         * @returns {jQuery}
         */
        deleteAll: function (params) {
            var ids = [];
            $(".selectall-item").each(function (e) {
                if ($(this).prop('checked')) {
                    ids.push($(this).val());
                }
            });

            if (ids.length == 0) {
                swal('', '', 'warning');
                return false;
            }
            params.data = {ids: ids};
            params.type = 'POST';
            this.delete(params);
        }
    };
})(Rbac);

var Summer = window.Summer || {};

/**
 * ajax
 * @module
 */
(function (Summer) {

    Summer.queue = {
        request: function (params) {
            var params = params || {},
                _data = params.data || {},
                _title = params.title || '...',
                _type = params.type || 'info',
                _html = params.html || "...<br><br><br><br>",
                _successTitle = params.successTitle || '';

            swal.queue([{
                type: _type,
                title: _title,
                html: _html,
                showConfirmButton: false,
                allowEscapeKey: false,
                allowOutsideClick: false,
                onOpen: function () {
                    return new Promise(function (resolve) {
                        Rbac.ajax.request({
                            successTitle:_successTitle,
                            close: true,
                            href: params.href,
                            data:_data,
                            successFnc: function () {
                                return false;
                            }
                        });
                    })
                }
            }])
        }
    };
})(Summer);